docs/API_REFERENCE.html.body:
API Reference
Overview
HeroUI MCP Server ‡πÉ‡∏´‡πâ‡∏ö‡∏£‡∏¥‡∏Å‡∏≤‡∏£ API ‡∏ó‡∏µ‡πà‡∏Ñ‡∏£‡∏≠‡∏ö‡∏Ñ‡∏•‡∏∏‡∏°‡∏™‡∏≥‡∏´‡∏£‡∏±‡∏ö‡∏Å‡∏≤‡∏£‡∏™‡∏£‡πâ‡∏≤‡∏á‡πÅ‡∏•‡∏∞‡∏à‡∏±‡∏î‡∏Å‡∏≤‡∏£ UI components ‡∏ú‡πà‡∏≤‡∏ô Model Context Protocol
Base URL
http://localhost:3000/api
Authentication
‡∏õ‡∏±‡∏à‡∏à‡∏∏‡∏ö‡∏±‡∏ô‡πÑ‡∏°‡πà‡∏ï‡πâ‡∏≠‡∏á‡∏Å‡∏≤‡∏£ authentication ‡πÅ‡∏ï‡πà‡∏≠‡∏≤‡∏à‡∏°‡∏µ‡∏Å‡∏≤‡∏£‡πÄ‡∏û‡∏¥‡πà‡∏°‡πÉ‡∏ô‡∏≠‡∏ô‡∏≤‡∏Ñ‡∏ï
Components API
Button Component (HERO_CMP_01)
Create Button
POST /components/button

// Request Body
{
  "text": "Click Me",
  "variant": "primary" | "secondary" | "danger" | "success",
  "size": "small" | "medium" | "large",
  "disabled": boolean,
  "onClick": string // JavaScript function
}

// Response
{
  "id": "btn_123",
  "html": "Click Me",
  "css": ".hero-btn { ... }",
  "js": "function onClick() { ... }"
}

Input Component (HERO_CMP_02)
Create Input
POST /components/input

// Request Body
{
  "type": "text" | "email" | "password" | "number",
  "placeholder": string,
  "label": string,
  "required": boolean,
  "validation": {
    "pattern": string,
    "minLength": number,
    "maxLength": number
  }
}

Card Component (HERO_CMP_03)
Create Card
POST /components/card

// Request Body
{
  "title": string,
  "content": string,
  "image": string,
  "actions": Array
}

Layout API
Grid Layout (HERO_LAY_01)
Create Grid
POST /layout/grid

// Request Body
{
  "columns": number,
  "rows": number,
  "gap": string,
  "responsive": {
    "mobile": number,
    "tablet": number,
    "desktop": number
  }
}

Flexbox Layout (HERO_LAY_02)
Create Flexbox
POST /layout/flexbox

// Request Body
{
  "direction": "row" | "column",
  "justify": "start" | "center" | "end" | "space-between" | "space-around",
  "align": "start" | "center" | "end" | "stretch",
  "wrap": boolean
}

Theme API
Color Theme (HERO_THM_01)
Set Color Theme
POST /theme/colors

// Request Body
{
  "primary": string,
  "secondary": string,
  "accent": string,
  "background": string,
  "text": string,
  "error": string,
  "warning": string,
  "success": string
}

Typography Theme (HERO_THM_02)
Set Typography
POST /theme/typography

// Request Body
{
  "fontFamily": string,
  "fontSize": {
    "xs": string,
    "sm": string,
    "md": string,
    "lg": string,
    "xl": string
  },
  "fontWeight": {
    "light": number,
    "normal": number,
    "medium": number,
    "bold": number
  }
}

Canvas API
Basic Drawing (HERO_CVS_01)
Create Canvas
POST /canvas/create

// Request Body
{
  "width": number,
  "height": number,
  "background": string
}

// Response
{
  "canvasId": string,
  "element": string
}

Draw Shape
POST /canvas/{canvasId}/shape

// Request Body
{
  "type": "rectangle" | "circle" | "line" | "polygon",
  "x": number,
  "y": number,
  "width": number,
  "height": number,
  "fill": string,
  "stroke": string,
  "strokeWidth": number
}

Advanced Tools API
Animation (HERO_ADV_01)
Create Animation
POST /advanced/animation

// Request Body
{
  "target": string, // CSS selector
  "keyframes": Array,
  "duration": number,
  "easing": string,
  "iterations": number | "infinite"
}

State Management (HERO_ADV_02)
Create Store
POST /advanced/store

// Request Body
{
  "initialState": object,
  "reducers": object,
  "middleware": Array
}

Templates API
Page Template (HERO_TPL_01)
Create Page
POST /templates/page

// Request Body
{
  "layout": string,
  "header": object,
  "content": Array,
  "footer": object,
  "meta": {
    "title": string,
    "description": string,
    "keywords": Array
  }
}

Memory Management API
Session Management
Create Session
POST /memory/session

// Request Body
{
  "userId": string,
  "data": object,
  "ttl": number // seconds
}

Get Session
GET /memory/session/{sessionId}

// Response
{
  "sessionId": string,
  "userId": string,
  "data": object,
  "createdAt": string,
  "expiresAt": string
}

Object Storage API
Store Object
POST /objects

// Request Body
{
  "key": string,
  "value": any,
  "metadata": object
}

Retrieve Object
GET /objects/{key}

// Response
{
  "key": string,
  "value": any,
  "metadata": object,
  "createdAt": string,
  "updatedAt": string
}

Error Handling
Error Response Format
{
  "error": {
    "code": string,
    "message": string,
    "details": object
  }
}

Common Error Codes

INVALID_REQUEST: Request body ‡πÑ‡∏°‡πà‡∏ñ‡∏π‡∏Å‡∏ï‡πâ‡∏≠‡∏á
NOT_FOUND: Resource ‡πÑ‡∏°‡πà‡∏û‡∏ö
VALIDATION_ERROR: ‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•‡πÑ‡∏°‡πà‡∏ú‡πà‡∏≤‡∏ô validation
INTERNAL_ERROR: ‡∏Ç‡πâ‡∏≠‡∏ú‡∏¥‡∏î‡∏û‡∏•‡∏≤‡∏î‡∏†‡∏≤‡∏¢‡πÉ‡∏ô‡πÄ‡∏ã‡∏¥‡∏£‡πå‡∏ü‡πÄ‡∏ß‡∏≠‡∏£‡πå

Rate Limiting

100 requests per minute per IP
1000 requests per hour per API key

Webhooks
Component Events
POST /webhooks/components

// Event Types
- component.created
- component.updated
- component.deleted

Theme Events
POST /webhooks/themes

// Event Types
- theme.applied
- theme.updated

SDK Usage
JavaScript/TypeScript
import { HeroUIClient } from '@heroui/client';

const client = new HeroUIClient({
  baseURL: 'http://localhost:3000',
  apiKey: 'your-api-key'
});

// Create button
const button = await client.components.createButton({
  text: 'Hello World',
  variant: 'primary'
});

// Create layout
const grid = await client.layout.createGrid({
  columns: 3,
  gap: '1rem'
});

Python
from heroui import HeroUIClient

client = HeroUIClient(
    base_url='http://localhost:3000',
    api_key='your-api-key'
)

# Create button
button = client.components.create_button(
    text='Hello World',
    variant='primary'
)

Examples
Complete Page Example
// 1. Create theme
const theme = await client.theme.setColors({
  primary: '#007bff',
  secondary: '#6c757d'
});

// 2. Create layout
const layout = await client.layout.createGrid({
  columns: 12,
  gap: '1rem'
});

// 3. Create components
const header = await client.components.createCard({
  title: 'Welcome',
  content: 'This is a sample page'
});

const button = await client.components.createButton({
  text: 'Get Started',
  variant: 'primary'
});

// 4. Create page template
const page = await client.templates.createPage({
  layout: layout.id,
  content: [header.id, button.id]
});

