Component Examples
1. Button Components
// Primary button
const primaryButton = await client.components.createButton({
  text: 'Primary Action',
  variant: 'primary',
  size: 'large',
  disabled: false
});

// Secondary button with icon
const secondaryButton = await client.components.createButton({
  text: 'Secondary Action',
  variant: 'secondary',
  size: 'medium',
  icon: 'arrow-right',
  iconPosition: 'right'
});

// Danger button
const dangerButton = await client.components.createButton({
  text: 'Delete',
  variant: 'danger',
  size: 'small',
  confirmMessage: 'Are you sure you want to delete this item?'
});

2. Form Components
// Contact form
const contactForm = await client.components.createForm({
  fields: [
    {
      type: 'text',
      name: 'name',
      label: 'Full Name',
      required: true,
      placeholder: 'Enter your full name'
    },
    {
      type: 'email',
      name: 'email',
      label: 'Email Address',
      required: true,
      validation: {
        pattern: '^[^@]+@[^@]+\.[^@]+$',
        message: 'Please enter a valid email address'
      }
    },
    {
      type: 'textarea',
      name: 'message',
      label: 'Message',
      required: true,
      rows: 5,
      maxLength: 500
    }
  ],
  submitButton: {
    text: 'Send Message',
    variant: 'primary'
  },
  onSubmit: 'handleContactFormSubmit'
});

3. Card Components
// Product card
const productCard = await client.components.createCard({
  image: 'https://example.com/product.jpg',
  title: 'Premium Headphones',
  description: 'High-quality wireless headphones with noise cancellation',
  price: '$299.99',
  actions: [
    {
