    user: null,
    theme: 'light',
    notifications: []
  },
  actions: {
    setUser: (state, user) => ({ ...state, user }),
    toggleTheme: (state) => ({
      ...state,
      theme: state.theme === 'light' ? 'dark' : 'light'
    }),
    addNotification: (state, notification) => ({
      ...state,
      notifications: [...state.notifications, notification]
    })
  }
});

